import React from "react";
import { Box } from "@mui/material";
import ShoppingCartIcon  from "@mui/icons-material/ShoppingCartIcon";

const Cart1 = () => {
  return (
    <Box>
      <ShoppingCartIcon stype={{backgroundColor: "red"}}/>
    </Box>
  );
};

export default Cart1;
